using System;
using System.Collections.Generic;

namespace LengthOfLongestSubstring
{
    class Program
    {
        static bool DuplicateCharacter(string input)
        {
            Dictionary<char, int> dic = new Dictionary<char, int>();
            for (int i = 0; i < input.Length; i++)
            {
                dic[input[i]] = 0;
            }
            for (int i=0;i<input.Length;i++)
            {
                dic[input[i]]++;
            }
            foreach(KeyValuePair<char,int> item in dic)
            {
                if(item.Value>1)
                {
                    return true;
                }
            }
            return false;
        }
        static int LengthOfLongestSubstring(string s)
        {
            if(s.Length==1)
            {
                return 1;
            }
            string chuoi = "";
            int max = 0;
            for(int i=0;i<s.Length;i++)
            {
                for(int j=i;j<s.Length;j++)
                {
                    chuoi += s[j];
                    if(DuplicateCharacter(chuoi))
                    {
                        if(max<j-i)
                        {
                            max = j - i;
                        }
                        chuoi = "";
                        break;
                    }
                    if (j == s.Length -1)
                    {
                        if (max <= j - i)
                        {
                            max = j - i+1;
                        }
                        chuoi = "";
                    }
                }
            }
            return max;
        }
